    false,nt"url": null,nt"notes": "2007/08 Progress Report results for all
    schools (data as of 1/13/09)rnrnPeer indices are calculated differently depending
    on School Level.  Schools are only compared to other schools in the same School
    Level (e.g., Elementary, K-8, Middle, High)rnrn1) Elementary & K-8 - peer index
    is a value from 0-100.  We use a composite demographic statistic based on % ELL,
    % SpEd, % Title I free lunch, and % Black/Hispanic.  Higher values indicate student
    populations with higher need.rnrn2) Middle & High - peer index is a value from 1.00-4.50.
     For middle schools, we use the average 4th grade proficiency ratings in ELA and
    Math for all their students that have 4th grade test scores.  For high schools,
    we use the average 8th grade proficiency ratings in ELA and Math for all their students
    that have 8th grade test scores, % SpEd, and % Overage.  Lower values indicate student
    populations with higher need.rnrn3) Schools for Transfer Students - peer index is
    a value from 1.00-4.50.  We use the average 8th grade proficiency ratings in ELA
    and Math for all their students that have 8th grade test scores and the % Overage/Under
    credited.  Lower values indicate student populations with higher need.  Unlike Elementary,
    Middle, and High School Progress Reports, the Environment Category is only composed
